import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
import Home from './Pages/home/Home.jsx';
import Introduction from "./Pages/introduction/Introduction.jsx";
import Chapter1 from './Pages/chapter1/Chapter1.jsx'
// import chapter2 from "./Pages/introduction/Introduction.jsx";
// import chapter3 from "./Pages/introduction/Introduction.jsx";
// import chapter4 from "./Pages/introduction/Introduction.jsx";
// import chapter5 from "./Pages/introduction/Introduction.jsx";
// import chapter6 from "./Pages/introduction/Introduction.jsx";
// import chapter7 from "./Pages/introduction/Introduction.jsx";
// import chapter8 from "./Pages/introduction/Introduction.jsx";
// import chapter9 from "./Pages/introduction/Introduction.jsx";
// import chapter10 from "./Pages/introduction/Introduction.jsx";
// import chapter11 from "./Pages/introduction/1.jsx";
// import chapter12 from "./Pages/introduction/Introduction.jsx";
// import chapter13 from "./Pages/introduction/Introduction.jsx";


function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path='introduction' element={<Introduction />} />
          <Route path='chapter1' element={<chapter1 />} />
          <Route path='chapter2' element={<chapter2 />} />
          <Route path='chapter3' element={<chapter3 />} />
          <Route path='chapter4' element={<chapter4 />} />
          <Route path='chapter5' element={<chapter5 />} />
          <Route path='chapter6' element={<chapter6 />} />
          <Route path='chapter7' element={<chapter7 />} />
          <Route path='chapter8' element={<chapter8 />} />
          <Route path='chapter9' element={<chapter9 />} />
          <Route path='chapter10' element={<chapter10 />} />
          <Route path='chapter11' element={<chapter11 />} />
          <Route path='chapter12' element={<chapter12 />} />
          <Route path='chapter13' element={<chapter13 />} />
          <Route path='chapter14' element={<chapter14 />} />
          <Route path='chapter15' element={<chapter15 />} />
          <Route path='chapter16' element={<chapter16 />} />
          <Route path='chapter17' element={<chapter17 />} />
          <Route path='chapter18' element={<chapter18 />} />
          <Route path='chapter19' element={<chapter19 />} />
          <Route path='chapter20' element={<chapter20 />} />



        </Routes>
      </BrowserRouter>
    </div>
  );
}
export default App;
